 @missplainjane3905  Yes, I speak fluent Chinese and travelled all over China. People in the countryside also use the digital payment, because the cell coverage is excellent. Even the old ladies at the rural vegetable markets prefer digital payments. 

Of course, high in the mountains or deep in the woods, there won't be any coverage. But in a few years, low orbiting satellites will provide 100% coverage, which would be mind-blowing. 

Foreign tourists, on the other hand, would be tricky. I know they are trying to make the system more tourist friendly. But if joining tour group is not your thing, you might need to look up online to see how foreign tourists get by on their own. Judging from plenty of foreign backpackers in China, I'm sure there is a way.

